import React,{Component} from 'react'
import { BrowserRouter,Switch, Route, Redirect, Link} from 'react-router-dom';
import {Details,Vitals} from './patient_componenets'
// import {Vitals} from './patient_vitals'
// import { NavBar } from './navbar';

export class Linker extends Component {
    render(){
        return(
        <div>
          <BrowserRouter>
            <nav>
                <Link to="/Details">Details</Link>
                <br></br>
                <Link to="/Vitals">Vitals</Link>
                <Route path="/Details" component={Details} exact/>
                <Route path="/Vitals"  component={Vitals} />
            </nav>
          </BrowserRouter>
        </div>
        )
    }
}
export class DetailsLinker extends Component {
    render(){
        return(
        <div>
          <BrowserRouter>
                <Link to="/Details">Details</Link>
                <Route path="/Details" component={Details} />
          </BrowserRouter>
        </div>
        )
    }
}

export class VitalsLinker extends Component {
    render(){
        return(
        <div>
          <BrowserRouter>
                <Link to="/Vitals">Vitals</Link>
                <Route path="/Vitals"  component={Vitals} />
          </BrowserRouter>
        </div>
        )
    }
}

